import React from "react";
import {
  EmailShareButton,
  EmailIcon,
  FacebookShareButton,
  FacebookIcon,
  LinkedinShareButton,
  LinkedinIcon,
  TwitterShareButton,
  TwitterIcon,
} from "react-share";

function Header() {
  const shareUrl = 'https://engagementtracker.net'

  return (
    <div className="header">
      <div className="headerText">version 1</div>
        <LinkedinShareButton className="socialButton" url={shareUrl} >
          <LinkedinIcon size={40} round={true} />
        </LinkedinShareButton>
        <TwitterShareButton className="socialButton" url={shareUrl} >
          <TwitterIcon size={40} round={true} />
        </TwitterShareButton>
        <FacebookShareButton className="socialButton" url={shareUrl} >
          <FacebookIcon size={40} round={true} />
        </FacebookShareButton>
        <EmailShareButton className="socialButton" url={shareUrl} >
          <EmailIcon size={40} round={true} />
        </EmailShareButton>
    </div>
  );
}

export default Header;
